import React from 'react';
import d from './Dialog.module.css';
import { NavLink } from 'react-router-dom';

export default class Dialog extends React.Component {
  addHref = () => {};

  render() {
    return (
      <div className={d.item}>
        <div className={d.dialogs}>
          <div className={d.dialog} onClick={this.addHref}>
            <NavLink exact to='/paf'>
              Sasha
            </NavLink>
          </div>
          <div className={d.dialog}>Tyom</div>
          <div className={d.dialog}>Viktoria</div>
          <div className={d.dialog}>Ash</div>
          <div className={d.dialog}>Ann</div>
          <div className={d.dialog}>Ani</div>
        </div>
        <div className={d.message}>
          <div className={d.msg}>Hi</div>
          <div className={d.msg}>How is your komasutra?</div>
          <div className={d.msg}>Yo</div>
        </div>
      </div>
    );
  }
}
